import React from 'react';
import Particles from 'react-particles-js';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import './App.css';

const particlesOptions ={
  particles: {
    number: {
      value: 80,
      density: {
        enable: true,
        value_area: 800
      }
    },
    size: {
      value:5
    },
    color: {
      value: '#1eff40'
    },
    move: {
      enable:true
    },
    shape: {
      type:'star'
    },
    line_linked: {
      shadow: {
        enable: true,
        color: "#ff261e",
        blur: 5
      },
      color: "#0a0a09"
    },
  },
  move: {
    enable: true,
    speed: 6,
    direction: 'none',
    random: false,
    straight: false,
    out_mode: 'out',
    bounce: false,
   attract: {
      enable: false,
      rotateX: 600,
      rotateY: 1200
    },

  interactivity: {
    detect_on: 'canvas',
    events: {
      onhover: {
        enable: true,
        mode: 'repulse'
      },
    modes:{
      repulse: {
        distance: 200,
        duration: 0.4
    },
    retina_detect: true
    /*onhover:{
      enable: true,
      mode: "repulse"
    },
    modes:{
      repulse: {
        distance: 200
        }
      }
    },*/
  }
}}
}}

function App() {
  return (
    <div className="App">
      <Particles className= 'particles'
        params={particlesOptions} 
      />
      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm />
      {/*<FaceRecogniction />*/}
    </div>
  );
}

export default App;
